function searchLaptop() {
    const laptopName = document.getElementById('Input').value;
    const resultDiv = document.getElementById('result');



    const LaptopData = {
        'acer': "data:image/jpeg;base64,"
        ,
        'apple': "data:image/jpeg;base64,",
        'hp': "data:image/jpeg;base64,",

        'vostro': 'data:image/jpeg;base64,',
        'dell': "data:image/jpeg;base64,",
        'lenovo': "data:image/jpeg;base64,"

    };



    if (LaptopData[laptopName]) {
        resultDiv.innerHTML = `
            <div class="Laptop-name">${laptopName}</div>
            <img src="${LaptopData[laptopName]}" alt="${laptopName}" class="laptop-image">
        `;
    } else {
        resultDiv.innerHTML = `<div class="Laptop-name">Laptop not found</div>`;
    }






}


























